/*
 * This function allocates all EDCS_Mapping_Entry structures for
 * those ECs that require them for their mapping types, since we can't reliably statically
 * allocate the union in the EDCS_Mapping_Entry.
 */
EDCS_Status_Code
local_init_ec_mapping( void )
{
    EDCS_Mapping_Entry *temp_entries = NULL;

    EDCS_3p1_4px_Class_Mappings[1094].entry_count = 1;

    temp_entries = (EDCS_Mapping_Entry *) calloc(1, sizeof(EDCS_Mapping_Entry));

    if (temp_entries == NULL)
    {
         fprintf(stderr, "Fatal Error: Unable to allocate memory for mapping entry.\n");
         return EDCS_SC_OTHER_FAILURE;
    }
    temp_entries[0].type = EDCS_MAP_ENTRY_TYP_ATTR_VAL;
    temp_entries[0].u.attr_value_entry.ea_code = EAC_FUNCTIONAL_USE;
    temp_entries[0].u.attr_value_entry.ea_value.attribute_value_type = EDCS_AVT_ENUMERATION;
    temp_entries[0].u.attr_value_entry.ea_value.value.enumeration_value = EEC_FNUSE_TRANSPORTATION;
    EDCS_3p1_4px_Class_Mappings[1094].entry_list = temp_entries;

    temp_entries = NULL;

    return EDCS_SC_SUCCESS;
}


void
local_shutdown_ec_mapping(void)
{
    EDCS_Count i;

    for (i = 0; i < EDCS_3P1_TOTAL_EC; i++)
    {
        if (EDCS_3p1_4px_Class_Mappings[i].entry_count > 0)
        {
            /* any strings in the individual entry_list entries are statically initialized */
            free(EDCS_3p1_4px_Class_Mappings[i].entry_list);
            EDCS_3p1_4px_Class_Mappings[i].entry_list = NULL;
        }
    }
} /* end local_shutdown_ec_mapping */

EDCS_Status_Code
EDCS_Map3p1ClassificationCode
(
          EDCS_Integer                           ec_3p1_code_in,
    const EDCS_3p1_4px_Class_Mapping_Structure **mapping_info_out_ptr
)
{
    EDCS_Status_Code status = EDCS_SC_SUCCESS;

    if (!mapping_info_out_ptr)
    {
        status = EDCS_SC_NULL_REQUIRED_PARAMETER;
    }
    else if (!edcs_mapping_initialized)
    {
        fprintf(stderr, "Error: must call EDCS_Init3p1MappingInfo() before using this function\n");
        status = EDCS_SC_OTHER_FAILURE;
    }
    else if (ec_3p1_code_in < 1 || ec_3p1_code_in > EDCS_3P1_TOTAL_EC)
    {
        *mapping_info_out_ptr = NULL;
        status = EDCS_SC_INVALID_INPUT_CODE;
    }
    else
    {
        *mapping_info_out_ptr = &(EDCS_3p1_4px_Class_Mappings[ec_3p1_code_in-1]);
    }
    return status;
} /* end EDCS_Map3p1ClassificationCode */

static int
local_Compare3p1ECLabel
(
    const EDCS_3p1_EC_Label_Entry *a_ptr,
    const EDCS_3p1_EC_Label_Entry *b_ptr
)
{
    int result = 0;

    if (!a_ptr && b_ptr)
        return -1;
    else if (!a_ptr && !b_ptr)
        return 0;
    else if (a_ptr && !b_ptr)
        return 1;

    result = edcs_internal_strcmp(a_ptr->label_3p1, b_ptr->label_3p1);
    return result;
} /* end local_Compare3p1ECLabel */

EDCS_Status_Code
EDCS_3p1ClassificationCodeFromLabel
(
    const char         *ec_3p1_label_in,
          EDCS_Integer *ec_3p1_code_out
)
{
    EDCS_Status_Code status = EDCS_SC_SUCCESS;
    EDCS_3p1_EC_Label_Entry *search_result_ptr = NULL, target;

    if (!ec_3p1_code_out)
    {
        status = EDCS_SC_NULL_REQUIRED_PARAMETER;
    }
    else if (!ec_3p1_label_in)
    {
        *ec_3p1_code_out = 0;
        status = EDCS_SC_NULL_REQUIRED_PARAMETER;
    }
    else if (!edcs_mapping_initialized)
    {
        fprintf(stderr, "Error: must call EDCS_Init3p1MappingInfo() before using this function\n");
        return EDCS_SC_OTHER_FAILURE;
    }
    else
    {
        target.label_3p1  = ec_3p1_label_in;
        search_result_ptr = (EDCS_3p1_EC_Label_Entry *)
                            bsearch
                            (
                               &target,
                               EDCS_3p1_EC_Label_Array,
                               EDCS_3P1_TOTAL_EC,
                               sizeof(EDCS_3p1_EC_Label_Entry),
                               (int(*)(const void*,const void *))
                                      local_Compare3p1ECLabel
                            );

        if (search_result_ptr)
        {
            *ec_3p1_code_out = search_result_ptr->code_3p1;
        }
        else
        {
            status = EDCS_SC_INVALID_INPUT_LABEL;
        }
    }
    return status;
} /* end EDCS_3p1ClassificationCodeFromLabel */

EDCS_Status_Code
EDCS_Map3p1ClassificationLabel
(
    const char                                  *ec_3p1_label_in,
    const EDCS_3p1_4px_Class_Mapping_Structure **mapping_info_out_ptr
)
{
    EDCS_Status_Code status = EDCS_SC_SUCCESS;

    if (!mapping_info_out_ptr)
    {
        status = EDCS_SC_NULL_REQUIRED_PARAMETER;
    }
    else if (!ec_3p1_label_in)
    {
        *mapping_info_out_ptr = NULL;
        status = EDCS_SC_NULL_REQUIRED_PARAMETER;
    }
    else if (!edcs_mapping_initialized)
    {
        fprintf(stderr, "Error: must call EDCS_Init3p1MappingInfo() before using this function\n");
        status = EDCS_SC_OTHER_FAILURE;
    }
    else
    {
        EDCS_Integer cc_code;

        status = EDCS_3p1ClassificationCodeFromLabel(ec_3p1_label_in,
                                                   &cc_code);

        if (status == EDCS_SC_SUCCESS)
        {
            status = EDCS_Map3p1ClassificationCode(cc_code,
                                                   mapping_info_out_ptr);
        }
    }
    return status;
} /* end EDCS_Map3p1ClassificationLabel */

